import { Button } from "./componentes/Button";
import './styles/global.css'

function App() {
    return (
        <>
            <Button color="red">
                Botão 1
            </Button>
            <Button color="blue">
                Botão 2
            </Button>
            <Button color="green">
                Botão 3
            </Button>
        </>
    )
}

export default App;
